Here is a JSON schema for a beta cruiser with a placeholder for an array of weapons:

```json
{
  "$schema": "http://json-schema.org/draft-07/schema#",
  "title": "Beta Cruiser",
  "type": "object",
  "properties": {
    "name": {
      "type": "string",
      "description": "The name of the Beta Cruiser"
    },
    "model": {
      "type": "string",
      "description": "The model of the Beta Cruiser"
    },
    "year": {
      "type": "integer",
      "minimum": 2022,
      "description": "The year the Beta Cruiser was built"
    },
    "weapons": {
      "type": "array",
      "items": {
        "type": "string",
        "description": "The type of weapon the Beta Cruiser is equipped with"
      },
      "minItems": 1,
      "description": "An array of weapons the Beta Cruiser is equipped with"
    }
  },
  "required": ["name", "model", "year", "weapons"],
  "example": {
    "name": "beta-cruiser-1",
    "model": "mark-1",
    "year": 2022,
    "weapons": ["phaser", "[placeholder]"]
  }
}
```

In this schema, the `weapons` property is an array that can contain multiple weapons, but at least one weapon is required. The placeholder is represented by square brackets `[]` in the `example` object. You can replace the `[placeholder]` with the actual weapon type when providing a real example.

